import React from 'react'
import '../Styles/ProductsImage.css'

function ProductImageDesc(props) {
  return (
    <div className="productDesc">
        <h2>{props.name}</h2>
        <p>{props.desc}</p>
        <p>Price <strong>{props.price}</strong></p>
    </div>
  )
}

export default ProductImageDesc
